from collections import deque

def move(key, instr):
    if instr == 'L':
        if key % 3 == 1:
            return key
        else:
            return key - 1
    elif instr == 'R':
        if key % 3 == 0:
            return key
        else:
            return key + 1
    elif instr == 'D':
        if key > 6:
            return key
        else:
            return key + 3
    elif instr == 'U':
        if key < 4:
            return key
        else:
            return key - 3
    else:
        raise Exception

def findKey(key, instructions):
    if len(instructions) == 0:
        return key
    newKey = move(key, instructions.popleft())

    return findKey(newKey, instructions)

def main():
    #instructions = ['ULL', 'RRDDD', 'LURDL', 'UUUUD']
    instructions = ['', '', '', '', '']
    key = 5
    for i in instructions:
        converted = deque(i)
        key = findKey(key, converted)
        print(key)

if __name__ == "__main__":
    main()
